std::vector<std::string> parseBlocks(const std::string& csv) {
  std::istringstream iss(csv);

  std::vector<std::string> ret;
  std::string line;
  while(std::getline(iss, line, ',')) {
    ret.push_back(line);
  }

  return ret;
}


